import { Stack } from "@mui/material";
import AppBar from '@mui/material/AppBar';

import './App.css';
import SWRCalc from './swrcalc.js';
import Chart from './chart.js';

function App() {

  return (
      <Stack spacing={2}>
        <AppBar> SWR Calculator</AppBar>
        <SWRCalc />
      </Stack>
  );
}

export default App;
